import React from "react";
import { useNavigate } from "react-router-dom";
import { Search } from "lucide-react";
import IconCard from "../components/IconCard";
import Navbar from "../components/Navbar";

const features = [
  { name: "Trip Planner", icon: "üß≠", path: "/trip-planner" },
  { name: "City Explorer", icon: "üåÜ", path: "/city-explorer" },
  { name: "Search", icon: "üîç", path: "/search" },
  { name: "My Trips", icon: "üß≥", path: "/my-trips" },
  { name: "Itinerary", icon: "üóìÔ∏è", path: "/itinerary" },
  { name: "Translator", icon: "üí¨", path: "/translator" },
  { name: "Expense Split", icon: "üíµ", path: "/expenses" },
  { name: "Memories", icon: "üì∏", path: "/memories" },
  { name: "Weather", icon: "üå¶Ô∏è", path: "/weather" },
  { name: "Nearby", icon: "üìç", path: "/nearby" },
  { name: "Transport", icon: "üöå", path: "/transport" },
  { name: "Luggage", icon: "üéí", path: "/luggage" },
  { name: "Restrooms", icon: "üöª", path: "/restrooms" },
  { name: "Premium", icon: "üíé", path: "/premium" },
  { name: "Add Attraction", icon: "‚ûï", path: "/add-attraction" },
  { name: "Community", icon: "üë•", path: "/community" },
  { name: "Rewards", icon: "üéÅ", path: "/rewards" },
  { name: "Notifications", icon: "üîî", path: "/notifications" },
  { name: "Settings", icon: "‚öôÔ∏è", path: "/settings" },
  { name: "Profile", icon: "üôç‚Äç‚ôÄÔ∏è", path: "/profile" },
];

export default function HomePage() {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen bg-gradient-to-b from-indigo-600 to-blue-500 text-white flex flex-col">
      <Navbar />

      {/* Search Bar */}
      <div className="px-4 py-3">
        <div className="bg-white flex items-center px-3 py-2 rounded-full shadow-md">
          <Search className="text-gray-500 mr-2" />
          <input
            type="text"
            placeholder="Search destinations, attractions..."
            className="flex-1 outline-none text-gray-700 bg-transparent"
          />
        </div>
      </div>

      {/* Features Grid */}
      <div className="grid grid-cols-4 gap-4 p-4 overflow-y-auto">
        {features.map((f) => (
          <IconCard key={f.name} icon={f.icon} label={f.name} onClick={() => navigate(f.path)} />
        ))}
      </div>
    </div>
  );
}
